import './NewHire.css'

const NewHire= () => {
	return(
		<div className="NewHireColor Rectangle3">
		 <a className="rectangle5 position"> 
		 <p className="position text">New Hire </p>
		 </a>
		</div>
		);
};

export default NewHire;
